import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './pages/Login';

function App() {

  return (
    <BrowserRouter>
      <Routes >
        <Route exact path="/" component={Login} />
        <Route path="/login" component={Login} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
